insert into tutors (id, description, name) values ('f4a2bbaf-a71f-44de-9a9f-9d22012c94d0', 'Kirill comes from the Data Science consulting space with experience in finance, retail, transport and other industries. He was trained by the best analytics mentors at Deloitte Australia.', 'Kirill Eremenko');
insert into tutors (id, description, name) values ('f13c6739-4fcb-4427-8c50-3b9e31a2ae06', 'Angela is a developer with a passion for teaching. She is the lead instructor at the London App Brewery, London is leading Programming Bootcamp. She has helped hundreds of thousands of students learn to code and change their lives by becoming a developer. She has been invited by companies such as Twitter, Facebook and Google to teach their employees.', 'Dr. Angela Yu');
insert into tutors (id, description, name) values ('5105403f-3170-4c1e-ad49-d93e503a0565', 'Chris Barin is a professional web and app designer with nearly 10 years of Photoshop experience. He is also an Adobe Certified Instructor and Certified Photoshop Expert.', 'Cristian Doru Barin');
insert into tutors (id, description, name) values ('4ee99f57-c1dc-4ee4-ab3d-54817da79cef', 'Stephane is a solutions architect, consultant and software developer that has a particular interest in all things related to Big Data, Cloud & API. Stéphane is recognized as an AWS Hero and is an AWS Certified Solutions Architect Professional & AWS Certified DevOps Professional.', 'Stephane Maarek');
insert into tutors (id, description, name) values ('ceff17b2-436d-4a59-9cb6-225c0c521eae', 'Strongly motivated young IT expert, Linux enthusiast with a passion for troubleshooting network related problems. With an exceptional eye for details and a sense of urgency when it comes down to problem solving.', 'Ermin Kreponic');
insert into tutors (id, description, name) values ('f0890ec1-0d32-4d1a-9325-d1ee98307785', 'Businessman and entrepreneur, with a degree in electrical engineering and computer science, with great social and team skills, speaking multiple languages, ambitious, motivated and a hard worker.', 'Aldin Omerdic');
insert into tutors (id, description, name) values ('ff64b400-4d6b-4168-8f2d-97bcd6ea8402', 'Kyle is a Microsoft Certified Trainer (MCT) and a certified Microsoft Office Master Instructor and has been teaching and consulting for the past 20+ years on various computer applications.', 'Kyle Pew');
insert into tutors (id, description, name) values ('adb0d4c1-fae1-4e67-82b5-23b87eb9630a', 'Kirt Kershaw is President of Dream Force LLC and provides certified and professional training videos on Microsoft Office applications including: Access, Excel, Outlook, PowerPoint, Word, Project and Windows since 2000.', 'Kirt Kershaw');
insert into tutors (id, description, name) values ('e81810fa-c54e-4b4a-a5b5-94f67b3609bc', 'Andrew spends his daily time with graphic design, presentations, motion & animation, typography, video editing and online teaching. Most of his work is done in Adobe After Effects & Microsoft PowerPoint 2019 / 2021 / 365. He has completed more than 4000 graphic projects for clients, mostly including video animations like intros, outros and transitions for various YouTube channels & marketers.', 'Andrew Pach');
insert into tutors (id, description, name) values ('838032d7-f15c-45e1-9ae1-29e6120b8be6', 'Chris has sold more than 1,000,000 of his online business & self improvement courses in 12 languages in 196 countries and his courses have been profiled in Business Insider, NBC, Inc, Forbes, CNN, Entrepreneur & on other business news websites. Chris is the author of the #1 best selling online business course called "An Entire MBA in 1 Course®” & many other courses.', 'Chris Haroun');
